string[] parts = input.Split(' ');

int x = int.Parse(parts[1]);

List<Submission> submissions = new List<Submission>();

for (int i = 3; i < parts.Length; i += 4)
{
    submissions.Add(new Submission(int.Parse(parts[i]), parts[i + 1], parts[i + 2] == "correct", int.Parse(parts[i + 3])));
}

submissions.Sort();

Dictionary<int, int> tasks = new Dictionary<int, int>();
Dictionary<int, int> users = new Dictionary<int, int>();

foreach (Submission submission in submissions)
{
    if (submission.Correct)
    {
        if (!tasks.ContainsKey(submission.TaskId))
        {
            tasks.Add(submission.TaskId, x);
        }
        else
        {
            tasks[submission.TaskId]--;
        }

        if (!users.ContainsKey(submission.Id))
        {
            users.Add(submission.Id, tasks[submission.TaskId]);
        }
        else
        {
            users[submission.Id] += tasks[submission.TaskId];
        }
    }
    else
    {
        if (!users.ContainsKey(submission.Id))
        {
            users.Add(submission.Id, 0);
        }
    }
}

List<User> userList = new List<User>();

foreach (var user in users)
{
    userList.Add(new User(user.Key, user.Value));
}

userList.Sort();

foreach (var user in userList)
{
    System.Console.Write($"{user.Points} {user.Id} ");
